import React from "react";

const PageNavigation = () => {
  return (
    <div>
      <ul className="pagination">
        <li className="page-item">1</li>
        <li className="page-item">2</li>
        <li className="page-item">3</li>
      </ul>
    </div>
  );
};

export default PageNavigation;
